import React from "react";
import styled from "styled-components";

function HowItWorks() {
  return (
    <Section>
      <TextContent>
        <Subtitle>How It Works</Subtitle>
        <Title>Animal Detection System</Title>
        <Step>
          <StepNumber>1</StepNumber>
          <StepContent>
            <StepTitle>Record your observations</StepTitle>
            <StepDescription>
              Capture images of wildlife and record your observations using the app.
            </StepDescription>
          </StepContent>
        </Step>
        <Step>
          <StepNumber>2</StepNumber>
          <StepContent>
            <StepTitle>Share with fellow naturalists</StepTitle>
            <StepDescription>
              Upload your images and share your findings with the Wildlife Spotter community.
            </StepDescription>
          </StepContent>
        </Step>
        <Step>
          <StepNumber>3</StepNumber>
          <StepContent>
            <StepTitle>Discuss your findings</StepTitle>
            <StepDescription>
              Engage in discussions with other naturalists and learn from each otherâ€™s observations.
            </StepDescription>
          </StepContent>
        </Step>
        <UploadButton>Upload</UploadButton>
      </TextContent>
      <ImageUploadWrapper>
        <ImageUploadArea>
          <PlusIcon>+</PlusIcon>
          <UploadText>Add your image</UploadText>
        </ImageUploadArea>
      </ImageUploadWrapper>
    </Section>
  );
}

const Section = styled.section`
  display: flex;
  align-self: center;
  margin-top: 70px;
  width: 100%;
  max-width: 1110px;
  gap: 20px;

  @media (max-width: 991px) {
    max-width: 100%;
    flex-direction: column;
  }
`;

const TextContent = styled.div`
  display: flex;
  flex-direction: column;
  width: 50%;
  font-size: 16px;
  color: var(--Color, #162407);
  font-weight: 400;
  align-items: flex-start;
  text-align: left;

  @media (max-width: 991px) {
    width: 100%;
  }
`;

const Subtitle = styled.h2`
  font-family: Manrope, sans-serif;
  font-weight: 500;
  letter-spacing: 2px;
  text-transform: uppercase;

  @media (max-width: 991px) {
    max-width: 100%;
  }
`;

const Title = styled.h3`
  letter-spacing: -2.04px;
  margin-top: 15px;
  font: 500 32px Manrope, sans-serif;

  @media (max-width: 991px) {
    max-width: 100%;
  }
`;

const Step = styled.div`
  display: flex;
  align-items: center;
  margin-top: 30px;

  @media (max-width: 991px) {
    flex-direction: column;
    align-items: flex-start;
  }
`;

const StepNumber = styled.div`
  font-size: 24px;
  font-weight: 700;
  color: #78f279;
  margin-right: 16px;

  @media (max-width: 991px) {
    margin-right: 0;
  }
`;

const StepContent = styled.div`
  display: flex;
  flex-direction: column;
`;

const StepTitle = styled.h4`
  font-size: 20px;
  font-weight: 500;
  margin: 0 0 8px 0;
`;

const StepDescription = styled.p`
  font-size: 16px;
  margin: 0;
`;

const UploadButton = styled.button`
  font-family: Manrope, sans-serif;
  justify-content: center;
  align-items: center;
  font-size: 15px;
  font-weight: 700;
  border: none;
  cursor: pointer;
  border-radius: 40px;
  background-color: #78f279;
  padding: 12px 32px;
  color: #142800;
  text-decoration: none;
  display: flex;
  margin-top: 26px;
  width: 203px;
  @media (max-width: 991px) {
    padding: 12px 20px;
  }
`;

const ImageUploadWrapper = styled.div`
  display: flex;
  flex-direction: column;
  width: 50%;
  
  @media (max-width: 991px) {
    width: 100%;
    margin-left: 0;
  }
`;

const ImageUploadArea = styled.div`
  border-radius: 12px;
  background-color: #e6e4e4;
  display: flex;
  flex-direction: column;
  font-weight: 400;
  justify-content: center;
  align-items: center;
  width: 100%;
  padding: 120px 60px; /* Increase padding to match the height of the text content */
  border: 1px dashed #817575;

  @media (max-width: 991px) {
    margin-top: 30px;
    padding: 40px 20px;
  }
`;

const PlusIcon = styled.span`
  color: #817575;
  font: 120px/41% Manrope, sans-serif;

  @media (max-width: 991px) {
    font-size: 40px;
  }
`;

const UploadText = styled.p`
  color: var(--Color, #162407);
  text-align: center;
  letter-spacing: -0.26px;
  margin-top: 21px;
  font: 16px Manrope, sans-serif;
`;

export default HowItWorks;
